  true,\n\t\"url\": null,\n\t\"notes\": \"The MUTCD Official Rulings is a resource
  that allows web site visitors to obtain information about requests for changes,
  experiments, and interpretations related to the MUTCD that have been received by
  the FHWA. Copies of various documents (such as incoming request letters, response
  letters from the FHWA, progress reports, and final reports) that are available in
  both pdf and html formats may be viewed on this web site. The current status of
  experiments, as well as any contact information for the requestor that has been
  made a part of the public record, is also available.\",\n\t\"license_title\": \"Other
